import React from "react";
import { NavigationContainer } from "@react-navigation/native";
import { createStackNavigator } from "@react-navigation/stack";
import { StatusBar } from "expo-status-bar";
import { StyleSheet, Text, View ,SafeAreaView} from "react-native";
import loginComp from "./components/login/loginComp";
import forgotYourPasswordComp from "./components/login/forgotYourPasswordComp";
import NewPasswordComp from "./components/login/newPasswordComp";
import SendEmailComp from "./components/login/sendEmailComp";

export default function App() {
  const Stack = createStackNavigator();
  return (
    //  <SafeAreaView style={styles.container}>
      <NavigationContainer>
        <Stack.Navigator>
          <Stack.Screen name="Login" component={loginComp} />
          <Stack.Screen
            name="Forgot your password"
            component={forgotYourPasswordComp}
          />
      <Stack.Screen name="new Password" component={newPasswordComp} />
        </Stack.Navigator>
      </NavigationContainer>
      // </SafeAreaView>
      //  <View style={styles.container}>
      //   {/* <Text>nhjkj</Text> */}
      //    <SendEmailComp></SendEmailComp>
      //    <StatusBar style="auto" /> 
      // </View> 
    
  );
}

const styles = StyleSheet.create({
  container: {
    flex: 1,
    backgroundColor: "#fff",
    alignItems: "center",
    justifyContent: "center",
  },
});
